import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Welcome to Your Todo-app
        <nav>
        <ul>
          <li><a href="#">Home</a></li>
          <li><a href="#">About</a></li>
          <li><a href="#">Services</a></li>
          <li><a href="#">Contact</a></li>
        </ul>
      </nav>
      </header>

    </div>
  );
}

export default App;
